import React from "react";
import "../css/header.css";
import "../css/footer.css";
import "../css/phongtro.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSearch, faChevronDown, faMapMarkerAlt, faExpand, faPhoneVolume, faUser, faHeadset, faPhone } from "@fortawesome/free-solid-svg-icons";
import Header from "../components/Header";

const Phongtro = () => {
    const rooms = Array(10).fill({
        title: "Phòng trọ mới sửa 7/2023, Quận Tân Phú",
        location: "Lương Thế Vinh, Quận Tân Phú, TPHCM",
        price: "1.8 Triệu/tháng",
        size: "20 m²",
        description: "Giá từ 1800K, cam kết hình thật...",
        image: "/img/anh-mo-hinh-nha-removebg-preview.png",
    });

    return (
        <div>
            {/* Header */}
            <Header/>

            {/* Thanh tìm kiếm */}
            <div className="search-container">
                <div className="search-box">
                    <FontAwesomeIcon icon={faSearch} />
                    <input type="text" placeholder="Tìm kiếm phòng trọ..." />
                </div>
                <div className="filter-box">
                    {['Phòng trọ', 'Quận', 'Giá thuê', 'Diện tích'].map(filter => (
                        <button className="filter-btn" key={filter}>{filter} <FontAwesomeIcon icon={faChevronDown} /></button>
                    ))}
                </div>
            </div>

            {/* Danh sách phòng trọ */}
            <div className="room-list">
                {rooms.map((room, index) => (
                    <div className="room-card" key={index}>
                        <div className="room-image">
                            <img src={room.image} alt="Phòng trọ" />
                        </div>
                        <div className="room-info">
                            <h3 className="room-title">{room.title}</h3>
                            <p className="room-location"><FontAwesomeIcon icon={faMapMarkerAlt} /> {room.location}</p>
                            <p className="room-price">{room.price}</p>
                            <p className="room-size"><FontAwesomeIcon icon={faExpand} /> {room.size}</p>
                            <p className="room-description">{room.description}</p>
                            <a href="/chitietphongtro" className="btn-view">Xem chi tiết</a>
                        </div>
                    </div>
                ))}
            </div>

            {/* Phân trang */}
            <div className="pagination-container">
                <a href="#" className="prev">&laquo; Trước</a>
                {[1, 2, 3].map(page => (
                    <a href="#" className={`page ${page === 1 ? 'active' : ''}`} key={page}>{page}</a>
                ))}
                <a href="#" className="next">Tiếp &raquo;</a>
            </div>

            {/* Footer */}
            <footer>
                <div className="footer-box">
                    <div className="footer-box1">
                        <div className="logo-footer"><h1>Shome</h1></div>
                        <div className="contact-footer">
                            {[{icon: faPhoneVolume, title: "Hotline", text: "1900 1881"},
                              {icon: faUser, title: "Hỗ trợ khách hàng", text: "trogiup.Shome.com.vn"},
                              {icon: faHeadset, title: "Chăm sóc khách hàng", text: "hotro@Shome.com.vn"}].map((item, index) => (
                                <div className="contact-footer1" key={index}>
                                    <div className="icon"><FontAwesomeIcon icon={item.icon} /></div>
                                    <div className="content">
                                        <a>{item.title}</a><br/>
                                        <a>{item.text}</a>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </div>
                    <div className="footer-box2">
                        <div className="footer-box2-1">
                            <p>CÔNG TY CỔ PHẦN PROPERTYGURU VIỆT NAM</p>
                            <div className="content"><FontAwesomeIcon icon={faMapMarkerAlt} /> <p>Tầng 31, Keangnam Hanoi Landmark, Phạm Hùng, Nam Từ Liêm, Hà Nội</p></div>
                            <div className="content"><FontAwesomeIcon icon={faPhone} /> <p>(024) 3562 5939 - (024) 3562 5940</p></div>
                        </div>
                        <div className="footer-box2-2">
                            <iframe
                                src="https://www.google.com/maps/embed?pb=!1m12!1m8!1m3!1d7836.920516729088!2d106.6323671!3d10.8525553!3m2!1i1024!2i768!4f13.1!2m1!1zY8O0bmcgdmllbiBwaOG6p24gbeG7gW0gcXVhbmcgdHJ1bmcgdHBoY20!5e0!3m2!1sen!2s!4v1740563830373!5m2!1sen!2s"
                                width="100%" height="100%" style={{ border: 0, borderRadius: "30px" }} allowFullScreen
                                loading="lazy" referrerPolicy="no-referrer-when-downgrade"
                            ></iframe>
                        </div>
                    </div>
                </div>
            </footer>
        </div>
    );
};

export default Phongtro;
